import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Login from './Login';
import Register from './Register';
import firebase from 'firebase/compat/app';
import 'firebase/compat/auth';
import 'firebase/compat/firestore';
import { initializeApp } from "firebase/app";

const firebaseConfig = { apiKey: "AIzaSyDGxBN6F0v7o68gcOXCyCmgOkQP293yZj0",
authDomain: "tryapp-6176e.firebaseapp.com",
databaseURL: "https://tryapp-6176e-default-rtdb.firebaseio.com",
projectId: "tryapp-6176e",
storageBucket: "tryapp-6176e.appspot.com",
messagingSenderId: "8839635440",
appId: "1:8839635440:web:3fbf045edf66aa6b607d35",
measurementId: "G-MRNY3XCE1Z"  };
const app = initializeApp(firebaseConfig); // eslint-disable-next-line
const db = firebase.firestore(); // eslint-disable-next-line


const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/login">Login</Link>
            </li>
            <li>
              <Link to="/register">Register</Link>
            </li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
        </Routes>
      </div>
    </Router>
  );
};

const Home = () => {
  return (
    <div>
      <h1>Welcome to the Home Page</h1>
    </div>
  );
};

export default App;
